import './App.css';

function App() {
  const [articles, setArticles] = useState(null);

  useEffect(() => {
    getData();

    async function getData() {
      const key = '85062f74bccf4b33872bf17c11caaae6';
      const url = `https://newsapi.org/v2/everything?q=tesla&from=2021-10-20&sortBy=publishedAt&apiKey=${key}`;

      const response = await fetch(url);
      const data = await response.json();

      setArticles(data);
    }
  }, []);

  return (
    <div className='App'>
      <h1>Hey</h1>
    </div>
  );
}

export default App;
